import React from "react";
import Header from "./header";
import Footer from "./footer";
import Note from "./note";


function App(){
    return <div>
        <Header />
        <Note 
            title = "Delegation"
            note =   "Q. How many programmers does it take to change a light bulb? A. None  Its a hardware problem"
        />
        <Footer />
    </div>
}

export default App;
